import React, { Component } from "react";
import "../Assets/Login.css";
import { Card, Button } from "react-bootstrap";

export default class Login extends Component {
    render() {
        return (

            <form className="cuadro">
            <Card className="text-center">
            <Card.Header>Bienvenido </Card.Header>
            <Card.Body>
              <Card.Title>IDENTIFICACIÓN</Card.Title>
              <Card.Text>
                Identifíquese para conocer sus datos.
              </Card.Text>
              <div className='btn-group-vertical'>
                <Button href='paciente/login' variant="primary" className='btn btn-success btn-lg mt-2 rounded-0'>Paciente</Button>
                <Button variant="medico/login" className='btn btn-success btn-lg mt-2 rounded-0'>Médico</Button>
              </div>
            </Card.Body>
          </Card> 

                <h3 className="titulo">BIENVENIDO AL CENTRO DE SALUD</h3>
                <div></div>
                <div></div>
                <label className="cita">Para visualizar sus citas introduzca su DNI </label>
                   <div></div>
                <input  className="dni" placeholder="Introduzca su DNI" />
                <div></div>
                <button type="submit" className="btn">Mostrar citas</button>

            </form>
        );
    }
}
